import React from "react";
import "./Contact.css";
const Contact = () => {
  return (
    <div className="container  h-content">
      <div className="row ">
        <div className="col ">
          <p className="fs-1 text ">Contact Me</p>
        </div>
      </div>
      <div className="row bg-primary container-content">
        <div className="card-content ">
          <p className="pt-1">Llamame o dejame un Whp</p>
          <p className="fs-1 text lh-1">1132716458</p>
          <i class="bi bi-whatsapp "></i>
          <i class="bi bi-telephone-plus-fill p-5"></i>
        </div>
      </div>
    </div>
  );
};

export default Contact;
